import React from 'react';
const Api = ({consumir, perfiles, onChange, form}) =>(
    <div className="container">
        <div className="principal text-center mt-5">
            <label htmlFor="usuario" className="form-label">Nombre</label>
            <input required onChange={onChange} value={form.usuario} type="text" className="form-control" name="usuario" id="usuario" placeholder="Buscar Usuario" />
            <button onClick={consumir} className="btn btn-success mt-3">Consumir</button>
            <div className="mt-3">
            {
                perfiles.map(
                    (item, i) => (
                        <div>
                            <img src={item.avatar_url} alt="Perfil" />
                            <a target="_blank" rel="noreferrer" href={item.html_url} key={i}>{item.login}</a>
                        </div>
                    )
                )
            }
        </div>
        </div>
        
    </div>
);

export default Api;
